#define s(n) sin(n)
#define j(n,m) ((floor(n*m)+.5)/m)
void mainImage(out vec4 c, vec2 f )
{
    vec2 e = iResolution.xy,
         n = (f-e*.5)/e.y;
    float u = 6.28,
          g = u/4.,
          t = iTime,
          a = atan(n.y,n.x)/u,
          d = length(n), 
          b = j(a,33.),
          r = j(d,66.),
          x = t+r*99.,
          h = s(t+d),
          i = s((abs(b)+r)*22.+t)*.5+.5;
    vec2 q = vec2(s(b*u+g+s(x)*h)*r, s(b*u+s(2.*x)*h)*r);
    c = vec4(1.-pow(length(n-q),.3));
}
